import '../css/App.css';
import cloud from '../image/cloud.png';

function App() {
  return (
    <div className="App">
      <div className="cloud1"></div>
      <div className="cloud2">  <img src={cloud} alt="cloud" width='80pt' /></div>
      <div className="jfest"> <p >เทศกาล</p></div>
    </div>
  );
}

export default App;
